import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Homepage from './homepage.js';
import icon from './icon.png';
import me from './me.jpg';
import './App.css';
//import logo from './logo.svg';

class AboutMe extends Component {

  render() {
  return (
    <div>
      <div>
        <Link to='/' style={{textDecoration: "none"}}>
          <img src={icon} style={{height: '125px', bottom: '20px', zIndex: '2', marginRight: '20px'}}></img>
        </Link>
        </div>
        <div style={{flexDirection: 'row', justifyContent: 'center'}}>
        <img className="Photo" src={me} style={{height: '400px', bottom: '20px', zIndex: '2', borderWidth: '20px', borderColor: '#000000'}}></img>

        <div style={{backgroundColor: '#ff0d4d', padding: '10px', marginLeft: '20px', borderRadius: 3}}>
            <h4 className="name">Julia Opatrny</h4>
            <h6 style={{marginTop: '-20px', fontStyle: 'italic'}} className="name">jsopatrny@gmail.com</h6>
            <h6 style={{marginTop: '-25px'}}>(917) 208-2775</h6>
            <body style={{marginTop: '-10px', fontSize: '15px', marginBottom: '12px'}} className="name">I am based in NYC</body>
          </div>
        </div>
    </div>
  );
  }
}


export default AboutMe;
